// <!-- Created by: Ayushi Amin ; Last Edited: Aug 2, 2024 -->

import logo from './logo.svg';
import './App.css';

function App() { }

// loadNavbar.js
document.addEventListener('DOMContentLoaded', function() {
  fetch('navbar.html')
      .then(response => response.text())
      .then(data => {
          document.getElementById('navbar').innerHTML = data;
      });
});

export default App;
